=head1 DESCRIPTION

Maps a batch delete document request to a specific Amazon Q Business
data source connector sync job.

=head1 ATTRIBUTES


=head2 DocumentsAdded => Str

The current count of documents added from the data source during the
data source sync.


=head2 DocumentsDeleted => Str

The current count of documents deleted from the data source during the
data source sync.


=head2 DocumentsFailed => Str

The current count of documents that failed to sync from the data source
during the data source sync.


=head2 DocumentsModified => Str

The current count of documents modified in the data source during the
data source sync.


=head2 DocumentsScanned => Str

The current count of documents crawled by the ongoing sync job in the
data source.



